app.controller('addBreadCtrl', ['$scope', 'cameraFactory', 'breads', function ($scope, cameraFactory, breads) {

  $scope.breadData = {};

  $scope.buttonText = 'take a photo';

  function getPhoto (way) {
    if (!cameraFactory[way]) {
      return;
    }

    // $scope.breadData.img = '';
    // return;

    cameraFactory[way](function getPhoto (data, error) {
      if (data) {
        $scope.breadData.img = data;
        $scope.buttonText = 'take another photo';
        $scope.$digest();
      }
    });
  }
  $scope.getPhoto = getPhoto;

  function save (bread) {
    $scope.result = {};
    breads.addBread(bread, function whenDone (bread, result) {
      $scope.result = result;
      $scope.showResult = !$scope.showResult;
      if (result.style === 'positive') {
      	$scope.breadData = {};
      }
      $scope.$digest();
    });
  }
  $scope.save = save;

  function clear () {
    $scope.showResult = !$scope.showResult;
  }
  $scope.clear = clear;

}]);